# OEIS sequence: A074078

from math import ceil
from fractions import Fraction
def a(n):
    s = Fraction(n, 3)
    x, c = s, 0
    while x.denominator != 1:
        U = ceil(x)
        x, c = U*s, c+1
    return c
print([a(n) for n in range(3, 109)]) # _Michael S. Branicky_, Jan 09 2025

